            background-size: cover;
            background-position: center;
            background-attachment: fixed;
            position: relative;
        }

        .header {
            margin-top: 40px;
            margin-bottom: 20px;
        }

        .site-title {
            font-size: 36px;
            color: #8b6914; /* 丝绸之路主题色 */
            margin-bottom: 10px;
        }

        .social-icons a {
            margin: 0 10px;
            text-decoration: none;
        }

        .search-container {
            width: 80%;
            max-width: 700px;
            margin: 20px auto;
        }

        input[type="text"] {
            font-size: 16px;
            padding: 12px;
            width: 100%;
            border: 1px solid #ccc;
            border-radius: 8px;
            box-sizing: border-box;
        }

        input[type="submit"] {
            font-size: 16px;
            padding: 10px 20px;
            margin-top: 10px;
            border: none;
            border-radius: 5px;
            background-color: #8b6914;
            color: white;
            cursor: pointer;
            transition: background-color 0.3s;
        }

        input[type="submit"]:hover {
            background-color: #a67c1a;
        }

        .search-engines, .common-sites {
            width: 80%;
            max-width: 700px;
            margin: 20px auto;
            border-top: 1px solid #ddd;
            padding-top: 20px;
        }

        .section-title {
            text-align: left;
            color: #fff9e4;
            margin-bottom: 15px;
        }

        .button-group {
            display: flex;
            flex-wrap: wrap;
            grid-gap: 10px;
            justify-content: flex-start;
        }

        .button {
            background-color: #f0f0f0;
            border: 1px solid #ddd;
            border-radius: 5px;
            padding: 8px 15px;
            text-decoration: none;
            color: #333;
            font-size: 14px;
            transition: background-color 0.3s;
        }

        .button:hover {
            background-color: #e0e0e0;
        }

        /* 原有样式保留 */
        .logo {
            margin-top: 40px;
            display: block;
            width: 250px; 
            height: auto;
            margin-left: auto;
            margin-right: auto;
        }
        
        .logo-img {
            max-width: 300px;
            height: auto;
            display: block;
            margin: 0 auto;
            filter: drop-shadow(2px 2px 4px rgba(0, 0, 0, 0.3));
        }
    </style>
